import React from 'react';
import './ChatApp.css';

const name = 'T-800';
const online = true;


function ChatApp(){
    return(
        <div className="Contact">
            <img className="avatar" src="https://i.ytimg.com/vi/br8-4sUMf3I/maxresdefault.jpg" alt="T-800 avatar"/>
            <p className="name">{name}</p>
            <div className="" >
                {online ? <p className="status-online status-text">Online</p> : <p className="status-offline status-text">Offline</p>} 
            </div>
        </div>
    )
}

export default ChatApp;
